import Login from "../pages/MainLogin";
import SubmissionManagement from "../pages/SubmissionManagement";
import MemberManagement from "../pages/MemberManagement";
import MemberUpdate from "../pages/MemberUpdate";
import GroupManagement from "../pages/GroupManagement";
import CompleteDisplay from "../pages/CompleteDisplay";
import Vue from "vue";
import Router from "vue-router";

Vue.use(Router);

export default new Router({
  mode: 'history',
  routes: [
    {
      path: "/",
      name: "Login",
      component: Login
    },
    {
      path: "/submissionManagement",
      name: "SubmissionManagement",
      component: SubmissionManagement
    },
    {
      path: "/memberManagement",
      name: "MemberManagement",
      component: MemberManagement,
      props: true
    },
    {
      path: "/memberUpdate",
      name: "MemberUpdate",
      component: MemberUpdate,
      props: true
    },
    {
      path: "/groupManagement",
      name: "GroupManagement",
      component: GroupManagement
    },
    {
      path: "/completeDisplay",
      name: "CompleteDisplay",
      component: CompleteDisplay
    },
  ]
});
